import React from 'react';
//app
import styles from './ClaimsAcknowledgement.styles';
import { Overflow } from 'components';
import { LossInfoView } from './LossInfoViewCard'
//mui
import { makeStyles } from '@material-ui/core';
import { RegisterNewLossFixedBottomBar } from 'modules';


export function ClaimsAcknowledgementView(props) {
  const { lossInfo, activeStep, handleBack, isAllStepsCompleted, handleNext, policyInfo, claimInfo, underWritingInfo, underWritingGroupColumns } = props;

  const classes = makeStyles(styles, { name: 'ClaimsAcknowledgement' })();
  return (
    <>
      <div className={classes.wrapper}>

        <Overflow>
          <LossInfoView
            lossInfo={lossInfo}
            policyInfo={policyInfo}
            claimInfo={claimInfo}
            underWritingInfo={underWritingInfo}
            underWritingGroupColumns={underWritingGroupColumns}
            />
        </Overflow>

      </div>
      <RegisterNewLossFixedBottomBar
        lastStep={true}
        activeStep={activeStep}
        isAllStepsCompleted={isAllStepsCompleted}
        handleBack={() => { handleBack() }}
        handleNextSubmit={() => handleNext()}
      />
    </>
  );
}
